INSERT INTO `su_about` (`abt_id`, `abt_title`, `abt_des`, `abt_ban`, `abt_img`, `abt_type`) VALUES
(3, 'Our History', '<b> <u>  Beginning </u> </b> <br/><br/>\r\nIn the year 2000 when the world was moving towards a new millennium, South Asian Education Promotional Network was looking for a leader who could lead an innovative team to teach the lahorities the basics of person', '../../Images/Banner/aboutusnbanner.jpg', '../../Images/our_history.jpg', 'History'),
(6, 'Chief Minister&#39;s Message', 'This truly is self evident today that the progress of our country and development of our country rests with higher education standards that are compatible with the international academic standards. Superior Group of Colleges has impressed with its grand m', '../Images/Banner/dancing.jpg', '../../Images/cm.jpg', 'CM'),
(7, 'Chairman&#39;s Message', '', '../../Images/Banner/aboutusnbanner.jpg', '../../Images/chairman.jpg', 'Chairmans'),
(8, 'Chartered By The Govt of Punjab', 'Getting charter by Government of the Punjab as degree awarding institute in four faculties is a badge of distinction and unique honor for Superior College. Several other institutions applied for the same status but are struggling since long to get this ra', '../Images/Banner/dancing.jpg', '../../Images/hec.jpg', 'Charter'),
(10, 'Affiliations and Collaborations', 'To make education qualitative we have got academic affiliations with universities and colleges at home and abroad.\r\n<br/><br/>\r\nSuperior Group of Colleges has taken another initiative by exploring new horizons and joining hands with the top universities o', '../Images/Banner/dancing.jpg', '../../Images/collaboration.jpg', 'Affiliations'),
(14, 'Board of Advisors', '&#60;b&#62;Prof. Dr. Zafar Iqbal&#60;&#47;b&#62;&#60;br&#62;\r\nEx-Chairman, Affiliation Committee,&#60;br&#62;\r\nPunjab University, Lahore.&#60;br&#62;\r\nRegistrar, University of Health Sciences, Lahore.&#60;br&#62;&#60;br&#62;\r\n\r\n&#60;b&#62;Prof. Dr. Ehsan ', '../../Images/Banner/aboutusnbanner.jpg', '../../Images/boa.jpg', 'Advisors'),
(16, 'Superior', 'Coming Soon', '../Images/Banner/dancing.jpg', '../Images/Banner/dancing.jpg', 'Superior'),
(24, 'Daily Nai Baat', 'Daily “Nai Baat” is  an inspiration to rebuild Pakistan.  It’s the personification of our patriotic  spirit to serve the nation.&#60;br&#62;&#60;br&#62;  &#60;b&#62;The Moving Spirit&#60;&#47;b&#62;&#60;br&#62;&#60;br&#62;  Nai Baat is publishing from Lah', '../../Images/Banner/boomfmbanner.jpg', '../../Images/nai-baat.png', 'Daily Nai Baat'),
(28, 'Boom FM', 'BooM FM is a nonprofit Campus Radio of the ‘Superior University’ which cater the knowledge thirst of thousands of students of Pakistan. That’s why Chairman of the Superior Group, Professor Dr Chaudhary Abdul Rehman has declared the ‘BooM FM’ as a ‘Voice o', '../../Images/Banner/boomfmbanner.jpg', '../../Images/boom-fm.png', ' BoomFM'),
(32, 'The Superior Solutions (TSS)', 'The Superior Solutions remain focused on Open Source technologies as well as Microsoft & IBM areas. We endeavor to build websites, ERP Modules, web portals and provide IT Business Solutions with technology that is beneficial to our clients.  &#60;br&#62;&', '../../Images/Banner/tssbanner.jpg', NULL, 'SuperiorSolution'),
(33, 'Support Business', 'Coming SOon', '../../Images/Banner/url.jpg', '../Images/Banner/dancing.jpg', 'SupportBusiness'),
(34, 'Superior School Systems', 'Being the fastest growing Educational Group of Pakistan, we have decided to extend our educational expertise at School Level introducing franchises of two school systems: Superior Grammar School and The Spirit School.  &#60;br&#62;&#60;br&#62;  This contr', '../../Images/Banner/f_banner.jpg', '../../Images/f_3.jpg', 'School'),
(35, 'Superior Group of Colleges', 'Lahore is known as Pakistan&#39;s education capital, with more colleges and universities than any other city in the country. Most of the reputable universities are public, but in recent years there has also been an upsurge in the number of private univers', '../../Images/Banner/SGC.JPG', '../../Images/groupofcollg.jpg', 'Colleges'),
(36, NULL, 'In the year 2000, when the world was moving towards a new millennium, South Asian Educational Promotion Network (SAEPN) established Superior Group of Colleges under the young, dynamic, enthusiastic and passionate leadership of Prof. Dr. Ch. Abdul Rehman a', '../../Images/Banner/aboutusnbanner.jpg', '../../Images/join_logo.jpg', 'University'),
(39, 'Azra Naheed Medial College (ANMC)', 'ANMC has been established at Main Raiwind Road at 17-KM from Thokar NiazBaig Lahore and is at 15-minutes drive from Shaukat Khanum Cancer Research Hospital. The area is developing very fast and very near future it will be hub of Medical Education.  &#60;b', '../../Images/Banner/anmcaboutbanner.jpg', '''../../Images/anmcdetails.jpg', 'Medical College'),
(40, 'Ch Muhammad Akram Teaching &#39;s Research Hospital', 'Chaudhry Muhammad Akram Teaching & Research Hospital aims to provide the state of the art medical facilities to the poor patients of the area. It will give an excellent platform to our medical graduates, pharmacists and physiotherapists for clinical train', '../../Images/Banner/M.Sc_Medical_Ultrasound.jpg', '../../Images/researchhospital.jpg', 'Research Hospital'),
(41, 'Corperate Social Responsiblity', 'Falling in line with the mission of Facilitating Superior  human beings, the students, faculty & management of  Superior University used to act spontaneously to cope with  the disasters of natural calamities as its foremost social  responsibility. The sam', '''../../Images/Banner/insafbanner.png', '''../../Images/insafimage.png', 'Social Responsiblity'),
(42, 'BREEO', 'BREEO is acknowledged by successful professionals committed to use their knowledge and experience to deliver excellent results in designing and managing education&#47;career paths for students. Our strongly student centered approach to counseling means, w', '../../Images/Banner/Breeo.JPG', '../../Images/breeo_logo_high_res-01.jpg', 'BREEO');
