INSERT INTO `su_awards` (`Awr_Id`, `Awr_Title`, `Awr_Details`, `Awr_Image`, `Awr_Type`) VALUES
(5, 'Galas', 'Students can cherish their moment by attending the special galas which are organized to appreciate growing abilities of students. For this, welcome and farewell functions are arranged, whereby students are encouraged to display their talent and show their', '../../Images/Gallary/Gala.JPG', 'Campus Life'),
(6, 'Industrial Tours', 'The present age is the age of practical know-how and the College offers an ample opportunity to its students to visit uprising industries and top-class business organizations like Nestle, Packages, ICI, Dawood Hercules, Millat Tractors, Haier Electronics ', '../../Images/Gallary/Industrl.jpg', 'Campus Life'),
(7, 'Foreign Tours', 'Organized visits to the foreign countries give students a new boost and exposure of the surrounding culture. ?Superiors?, with outstanding academic background, visit foreign countries like England, UAE and India as special study tours either in summer or ', '../../Images/Gallary/Industrl.jpg', 'Campus Life'),
(8, 'Pleasure Trips', 'Seeking a meaningful pleasure is always natural to the human beings. This refreshes the mind, lessens the stress, dilutes the tension, and smoothes out worries. To this end, field tours to Murree, Swat and Kalam are arranged throughout the academic sessio', '../../Images/Gallary/PTour.JPG', 'Campus Life'),
(9, 'Sports Day', 'There is a broad spectrum of spectacular physical education in the form of indoor and outdoor sports activities. Opportunities for all staff and students are provided to take part in a range of multicolored sports at different levels of ability. The Colle', '../../Images/Gallary/SFestival.JPG', 'Campus Life'),
(10, 'Cultural Festival', 'An important milestone at the beginning of spring season is the Superior Cultural and Festival Show that provides perennial respite, unfolds the hidden talent and nourishes the students, faculties to the heights of delights. This vibrant and memorable eve', '../../Images/Gallary/SFestival.JPG', 'Campus Life'),
(11, 'Community Awards', 'The practice of giving away the best performance award to the college staff was initiated by late Malik Meraj Khalid during his life span. After his demise, Superior Group of Colleges, in all respects, followed the sublime mission of introducing professio', '../../Images/Gallary/Cmnty_awrd.jpg', 'Awards'),
(12, 'Faculty Awards', '<b/>?THE GREATEST REWARD FOR DOING IS THE OPPORTUNITY TO DO MORE? </b> <br/> <br/>\r\n\r\nTeachers have always been a sanctified and esteemed part of the community .As it is said that the nation which has a respect for its teachers is blessed with the grace o', '../../Images/Gallary/Fac_Award.jpg', 'Awards'),
(13, 'Administrative Awards', '<b>?Men Are Rich Only As They Give-- He Who Gives Great Services Gets Great Rewards?</b> <br><br>\r\n\r\nInspire, encourage, Appreciate, Attract Reinforce, motivate, nurture, retain, engage, thank and bring out the best in your employees. <br><br>\r\n\r\nUmrah Ti', '../../Images/Gallary/adminstrative_awrd.jpg', 'Awards'),
(14, 'Student Awards', '<b> ?DETERMINATION, EFFORT AND PRACTICE ARE REWARDED WITH SUCCESS?? </b> <br/><br/>\r\n\r\nAwards always encourage students. They are a source of motivation to achieve goals. As a continuation of our vision we are facilitating students in the pursuance of the', '../../Images/Gallary/student_award.jpg', 'Awards'),
(19, 'Transport', '''Transport facility is provided to students on affordable price. Students are all praises for the superior fleet for its:  <br>      Well defined routes touching all the corners of the city<br>      Efficient, comfortable and in time facility<br>      Pea', '''../../Images/Gallary/Transport.jpg', 'Facility'),
(20, 'Superior Library', '''Superior Bookshop is serving students routine academic needs. Students studying in different disciplines can easily avail themselves of the following:  <br/><br/>      Textbooks related to their syllabus.      <br/>Study packs prepared by the competent f', '''../../Images/Gallary/library.jpg', 'Facility');
