(3, 'We feel proud of our Alumni and feel honored that they are maintaining their identity of being Superior.', '../../Images/Gallary/alumni-1.jpg', 'amir', '2014-01-01'),
(4, 'Cafe is always a place of refreshment and entertainment for having breaks during strenuous academic routine.', '../../Images/Gallary/Cafe.jpg', 'amir', '2014-01-01'),
(6, 'Superior has signed MOU (Memorandums of Understanding) in the areas of student exchange', '../../Images/Gallary/mou.jpg', 'amir', '2014-01-01'),
(7, 'Superior University holds distinction in aviation studies as this is the pioneer department.', '../../Images/Gallary/aviation.jpg', 'amir', '2014-01-01'),
(8, 'Superior musical nights and concerts are cherished by students and their friends and fellows.', '../../Images/Gallary/concert.jpg', 'amir', '2014-01-01'),
(9, 'The Superior students are looked after with all the essential facilities.', '../../Images/Gallary/labs.jpg', 'amir', '2014-01-01'),
