(11, 'Ph.D. Business Administration', 'The Ph.D. Program in Business Administration is a demanding researchbased program with an emphasis on generating high quality research output. The program is designed to inculcate the skills and competencies required by active researchers', '../../Images/Gallary/commerce.jpg', '../Images/Gallary/thumb.jpg', 'Tag', 'OK', '5', 'A-Research'),
(12, 'MS/M.Phil Business Administration', 'This unique course focuses on skills for business research and skill-based approach to be both interesting and essential subsequent work. Azra Naheed Center for Research and Development is working hard to create a research culture and under its supervisio', '../../Images/Gallary/econ.jpg', '../../Images/Gallary/thumb.jpg', 'see', 'OK', '5', 'B-PostGrad'),
(13, 'MS/M.Phil Mass Communication Management', 'Every Individual or entity in today', '../../Images/Banner/BS(Hons)_Masscommunication.jpg', '../../Images/Gallary/thumb.jpg', 'see', 'OK', '5', 'A-Research'),
(14, 'MS Construction Management', 'Today', '../../Images/Banner/Bachelors_in_Architecture.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '5', 'B-PostGrad'),
(15, 'Ms/M.Phil Engineering Management', 'In today', '../../Images/Banner/B-Tech_Electrical-(Hons).jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '5', 'B-PostGrad'),
(16, 'MBA (Professional)', 'This program is specially designed for Fresh Graduates    <br/> Excellent Teaching Methodologies and Infrastructure maintaining International standards   <br/>  Offering a wide range of specializations in MBA Professional    <br/> Both Morning classes are', '../../Images/Banner/MBA_Professional.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '5', 'B-PostGrad'),
(17, 'MBA (1.5 Years)', 'One year degree program which is the best choice after BBA (Hon', '../../Images/Banner/MBA_After_4_years_BBA.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '5', 'B-PostGrad'),
(18, 'Masters in Mass Communication', 'In this era of globalization both print and electronic media have become the part and parcel of contemporary policies. People now are dependent on media for minute to minute information. This has made mass communication as one of the most prestigious, gla', '../../Images/Banner/BS(Hons)_Masscommunication.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '5', 'B-PostGrad'),
(19, 'MSc Quality Management', ' The Master of Science in Quality Management program is designed to prepare professionals for a top class career in the field of Quality Management within the diverse industrial and service sectors. The curriculum is designed and delivered with the assist', '', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '5', 'B-PostGrad'),
(20, 'M.Sc Environment, Health & Safety Management', 'Not Offering . . .', '../../Images/Banner/BBA_Hons.jpg', '../../Images/Gallary/thumb.jpg', 'NA', 'Not OK', '5', 'B-PostGrad'),
(21, 'BS Mass Communication', 'The department of Mass Communication Management has started a new program of Bachelors in Mass Communication. It equips the students with all forms of media and gives practical exposure to the upcoming Superiors of media Industry. <br/> This 4 years degre', '../../Images/Banner/BS(Hons)_Masscommunication.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '5', 'C-UnderGrad'),
(22, 'BS Industrial Management', ' BS Industrial Management as a precursor to its MS/M. Phil program prepares students to enter the industrial market as supervisors, operation managers, human resource technicians and start- up entrepreneurs.  <br/> Research, special projects and independe', '', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '5', 'C-UnderGrad'),
(23, 'MS Quality Management', 'Our learning and teaching methodologies with theoretical understanding and practical case study   <br/>  Excellent Infra Structure maintaining International standard    <br/> Our Split Degree Program enables Superior students to get international exposure', '../../Images/Gallary/econ.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '5', 'B-PostGrad'),
(24, 'MS HRM', 'MS Human Resource Management is designed for students having completed their 16 years of education, the students who are willing to launch their career in HR Profession or willing to improve their knowledge & degree in HR specific field . It is a research', '', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '5', 'B-PostGrad'),
(25, 'MS Industrial Management', 'Our learning and teaching methodologies with theoretical understanding and practical case study    <br/> Excellent Infra Structure maintaining International standard    <br/> Our Split Degree Program enables Superior students to get international exposure', '', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '5', 'B-PostGrad'),
(26, 'Ms/M.Phil Environment, Health & Safety', 'Not Offering . . .', '', '../../Images/Gallary/thumb.jpg', 'NA', 'Not OK', '5', 'B-PostGrad'),
(27, 'MBA (Executive)', 'Not Offering . . .', '../../Images/Banner/MBA_Professional.jpg', '../../Images/Gallary/thumb.jpg', 'NA', 'Not OK', '5', 'B-PostGrad'),
(28, 'MBA (2 years)', ' MBA 2 years : at Superior College is one of the evening programs offered to the candidates who are working in different business set ups and have minimum two years of experience. The on job professionals do understand the importance of MBA in this busine', '../../Images/Banner/MBA_2_years.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '5', 'B-PostGrad'),
(29, 'M.Sc Human Resource Management ', 'If you want to develop a career in HR, our excellently rated Masters in HRM  provides the perfect opportunity to achieve a Research degree and Professional  qualifications at the same time. This program is designed to shape a new  generation of HR profess', '../../Images/Gallary/econ.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '5', 'B-PostGrad'),
(30, 'BBA (Hons.)', 'After BBA Hons you are directly eligible for MS Programs     <br/>Guaranteed job placements for the students who score minimum 3.5 CGPA.    <br/> Our learning and teaching methodologies with theoretical understanding and practical case study     <br/>Stud', '../../Images/Banner/BBA_Hons.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '5', 'C-UnderGrad'),
(31, 'BS Aviation Management', 'No nation can achieve its planned aims without a good educational system that lays strong foundations upon which the superstructure of proficient professionals can be raised. In pursuance of this goal, BS Aviation Management has been designed in such a wa', '../../Images/Banner/BS_Aviation_Management.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '5', 'C-UnderGrad'),
(32, 'MS Computer Sciences', 'MS Computer Science is a two year program which provides specialization in the field of software engineering, networks and artificial intelligences. <br/> It also targets at widening the horizons of students by imparting deeper understanding and knowledge', '../../Images/Banner/MS_Computer_Sciences.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '3', 'B-PostGrad'),
(33, 'BS Computer Sciences', 'BS Computer Science program provides theoretical and practical knowledge of different areas of Computer Science through detailed course work and projects. <br/> The four year program enables students to pursue their careers as software engineers, programm', '../../Images/Banner/BS_Computer_Sciences.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '3', 'C-UnderGrad'),
(34, 'Masters of Information Technology', 'Managed by competent lecturers, trainers, experienced working professionals and scholars    <br/> Excellent Infrastructure maintaining International standards on par with international standards of education.   <br/>  Lab practice is available for student', '../../Images/Banner/Masters_in_Information_Technology.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '3', 'B-PostGrad'),
(35, 'BS Telecommunications', 'Managed by competent lecturers, trainers, experienced working professionals and scholars    <br/> Excellent infrastructure and studies stimulating environment.   <br/>  Indigenous labs for students of BS Telecommunications with particular emphasis on freq', '../../Images/Banner/BS_Telecommunication.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '3', 'C-UnderGrad'),
(36, 'BSc Electrical Engineering', 'The BS Electrical Engineering program is approved by the Higher Education Commission of Pakistan (HEC) while Pakistan Engineering Council (PEC) has given approval to launch this degree. <br/> The mission of the Superior University Electrical Engineering p', '../../Images/Gallary/bannerfet.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '6', 'C-UnderGrad'),
(37, 'BS Aviation Technology', 'Bachelors degree program in Aviation Technology prepares graduates for employment in number of different specialized areas of aviation. Aviation Technology graduates may become professional aircraft designers, aircraft maintenance specialists and more. Ma', '../../Images/Banner/BS_Aviation_Technology.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '6', 'C-UnderGrad'),
(38, 'BS Electrical', 'Superior University has initiated BS Electrical to meet the high demand for electrical technology graduates within and outside the country. The program is based on solid foundation in Mathematics, Physical Science, Computer Programming and Electrical Powe', '../../Images/Banner/B-Tech_Electrical-(Hons).jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '6', 'C-UnderGrad'),
(39, 'Bachelor in Architecture ', 'A program that prepares individuals for the independent professional practice of architecture and to conduct research in various aspects of the field including instruction in architectural design, history, and theory; building structures and environmental', '../../Images/Banner/Bachelors_in_Architecture.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '6', 'C-UnderGrad'),
(40, 'MS/M.Phil Economics', 'MS/M.Phil Mass Communication Management', '../../Images/Banner/Masters_in_Business_Economics.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '7', 'B-PostGrad'),
(41, 'MS/M.Phil Commerce & Finance', 'The commerce department is one of the most prestigious department of Superior College where you can find chances of learning through object oriented seminars, workshops on current Commerce and Finance issues. The huge range of support services available i', '../../Images/Gallary/commerce.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '7', 'B-PostGrad'),
(42, 'Masters in Business Economics', 'M.B. Econ is a great merge of economics and business studies which integrates the two closely related fields on an equal basis. This program is well conceived to prepare visionary human resources equipped by theoretically profound business skills in the p', '../../Images/Banner/Masters_in_Business_Economics.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '7', 'B-PostGrad'),
(43, 'M.Com (Morning/ Evening)', 'The commerce department is one of the most prestigious department of Superior College where you can find chances of learning through object oriented seminars, workshops on current Commerce and Business issues. The huge range of support services available ', '../../Images/Gallary/commerce.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '7', 'B-PostGrad'),
(44, 'B.Com (Hons.)', 'The commerce department is one of the most prestigious departments of Superior College where you can find chances of learning through object oriented seminars, workshops on current commerce and business issues. The huge range of support services available', '../../Images/Gallary/commerce.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '7', 'C-UnderGrad'),
(45, 'Doctor of Physiotherapy', 'Physiotherapy is an applied discipline dedicated to the study of human movement and function and its relevance to health and well-being is aimed at optimizing quality of life in both individuals and communities. In order to do this Physiotherapy involves ', '../../Images/Gallary/ANMCinner.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '8', 'B-PostGrad'),
(46, 'MBBS', 'Coming soon...', '../../Images/Banner/MBBS.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '8', 'B-PostGrad'),
(47, 'BS Accounting & Finance ', 'Our Accounting and Finance programs are accredited by the HEC and Foreign Universities leading to exemption from specific examinations. As the professional accountants are considered the key players within an organization because they audit company accoun', '../../Images/Gallary/econ.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '9', 'C-UnderGrad'),
(49, 'Pharm. D', 'Pharm. D (Doctor of Pharmacy) is a 5 Years Professional Degree Programme designed to develop students', '../../Images/Banner/Pharm_D.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '10', 'B-PostGrad'),
(50, 'Ph.D. in Law', '<b>Ph.D. in Law</b><br/> (Approved by HEC)<br/><br/>  Superior College feels proud in commencing Ph.d Programs under the expert guidance of Prof. Dr. Muhammad Naeem, ex-Dean Law, University of the Punjab and the present HEC approved supervisor for teachin', '../../Images/Banner/PhD-Law.jpg', '../../Images/Gallary/thumb.jpg', 'ok', 'OK', '11', 'A-Research'),
(51, 'LL.B', '<b>LL.B</b><br/><br/> Owing to the best faculty, infrastructure and facilities Superior College of Law has been granted highest intake of 750 seats by Punjab University making it the leading and largest institution in the province imparting legal educatio', '../../Images/Banner/LLB-(PU).jpg', '../../Images/Gallary/thumb.jpg', 'ok', 'OK', '11', 'B-PostGrad'),
(52, 'LL.M', '<b>LL.M</b><br/><br/>   (Approved by HEC)<br/>   Superior College feels proud in commencing LLM Programs under the expert guidance of Prof. Dr. Muhammad Naeem, ex-Dean Law, University of the Punjab and the present HEC approved supervisor for teaching LLM ', '../../Images/Banner/PhD-Law.jpg', '../../Images/Gallary/thumb.jpg', 'ok', 'OK', '11', 'B-PostGrad'),
(53, 'Bachelors of Economics and Law', '<b>Bachelors of Economics and Law</b><br/><br/>  First ever institute in Pakistan to start two year HEC recognized Bachelors degree in Economics and Law. It is open to those who have done F.A, FSc, I.Com or equivalent and wish to gain an introductory know', '../../Images/Banner/PhD-Law.jpg', '../../Images/Gallary/thumb.jpg', 'ok', 'OK', '11', 'C-UnderGrad'),
(67, 'M.Sc Economics', 'This masters level program is well conceived to prepare visionary ', '../../Images/Gallary/commerce.jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '7', 'B-PostGrad'),
(68, 'MS Electrical', ' Superior University has started MS Electrical with a commitment to contribute to the restricting for our domestic industry. Electrical Engineers have manifold opportunities for exciting careers ranging from designers of robots to factory automation, soft', '../../Images/Banner/B-Tech_Electrical-(Hons).jpg', '../../Images/Gallary/thumb.jpg', 'Rich', 'OK', '6', 'B-PostGrad'),
(69, 'FIA (FOUNDATIONS IN ACCOUNTANCY)', 'First time in the history of Pakistan At Superior Group of Colleges We have specially designed 4 Year Accounting & Finance Degree to ensure that it Responds to the needs and Expectations of the modern Accountancy profession', '../../Images/Banner/FIA.JPG', '../../Images/Gallary/CAT ACCA Broucher(final).pdf', '', 'OK', '9', 'B-PostGrad'),
(70, 'MS Information Technology', 'This degree equips them with  knowledge to develop and run a  whole organization by fulfilling  the technological requirements.', '../../Images/Banner/MS IT.jpg', '../../Images/Gallary/MS_Information_Technology.pdf', 'NA', 'OK', '3', 'B-PostGrad'),
(74, 'MS Project Management', 'In todays highly price conscious era, on time comple-tion of professional level projects is of paramount  importance to save huge expenditure and efforts  involved. Hence, Project Management has become one  of the important specialties in professional fie', '../../Images/Banner/MS PM.jpg', '../../Images/Gallary/MS_Project_Management.pdf', 'NA', 'OK', '5', 'B-PostGrad'),
(75, 'BS Information Technology', 'BS Information Technology degree program four years iternational standard degree Program. This degree is primarily focused on subjects such as software, databases, and networking. In general computer science degrees tend to focus on the mathematical and t', '../../Images/Banner/BS IT.jpg', '../../Images/Gallary/BS_Information_Technology.pdf', 'NA', 'OK', '3', 'C-UnderGrad'),
(76, 'BS Software Engineering', 'Software Engineering is an undergraduate degree program of study in the field of software development for computers in information technology.  "Software Engineering is the systematic development and application of techniques which lead to the creation of', '../../Images/Banner/BS SE.jpg', '../../Images/Gallary/BS_Software_Engineering.pdf', 'NA', 'OK', '3', 'C-UnderGrad'),
(77, 'Masters in Computer Science', ' Master of Science in Information Technology is a graduate degree designed for information technology professionals, it is generally based on core computer science subjects where knowledge can be used for advanced work especially in Information Technology', '../../Images/Banner/MCS.jpg', '../../Images/Gallary/Master_in_Computer_Sciences.pdf', 'NA', 'OK', '3', 'B-PostGrad'),
(78, 'MBA Professional (Evening/ Weekend)', 'This program is specially designed for Fresh Graduates Excellent Teaching Methodologies and Infrastructure maintaining International standards Offering a wide range of specializations in MBA Professional Evening Classes are available for students Guarante', '../../Images/Banner/MBAP.jpg', '../../Images/Gallary/MBA_Professional.pdf', 'NA', 'OK', '5', 'B-PostGrad'),
(80, 'MS/M.Phil Educational Leadership and Management (ELM)', 'The course has been designed for educational professionals who may be based in Pakistan or anywhere in the world and are working as, or aspire to be:<br/><br/>  <ul> <li>       a leader or manager in a school, college or university</li><br/> <li>         ', '../../Images/Banner/1.jpg', '../../Images/Gallary/1.jpg', 'NA', 'OK', '5', 'A-Research');
