(1, 'University of NewCastle, Australia', '../../Images/Gallary/logo_newcastle.jpg', '../../Images/Banner/Split_Ausbanner.jpg', ' With a history of more than 40 years, the University of Newcastle has grown from a locally focused institution to one the globally oriented and recognized institute. With a student population of around 28,000 and currently ranking in the top 10 Australia', '<b>Postgraduate Programs offered at the Newcastle Business School:</b> <br/><br/>  Masters of Business Administration<br/> Masters of Applied Finance<br/>  Masters of Marketing <br/> Masters of Human Resource Management<br/> Master of International Busine', 'Undergraduate Programs	&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp		AUD $ 19040	Per Annam <br/> Postgraduate Programs 	&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp		AUD $ 12,020 To AUD $ 25,840 Per Annam  ', 'Email: splitdegree@superior.edu.pk <br/> Phone: 042-35858043, 0321-4493971 <br/><br/> <center><img src="../../Images/SplitDegree/NewAus.JPG" /> </center>', 'No Data Recived'),
(2, 'Uppsala University, Sweden', '../../Images/Gallary/logo_uppsala.jpg', '../../Images/Banner/MOUswedenabanner.png', 'Quality knowledge and creativity since 1477 <br/> <br/>   With the history of more than 400 years, this university has a lot to offer to International Students. Uppsala is 75th Top University in World having 8 Noble Prizes with 500 Annual Publications. Th', '<b>Postgraduate Program:</b> <br/><br/>  MSc in Business and Economic (One Year Double Degree Program).<br/><br/>  As per the agreement between Superior University Lahore and Uppsala University Sweden, hereby agree for the double degree program, which inc', '''&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp<b>Average Fee</b><br/>Postgraduate Program	', 'Email: splitdegree@superior.edu.pk<br/> Phone: 042-35858043, 0321-4493971<br/><br/><center><img src="../../Images/SplitDegree/Uppsala2.JPG" /></center>', 'No Data Recived'),
(3, 'IESEG School of Management France', '../../Images/Gallary/ieseg.jpg', '../../Images/Banner/BannerSD.JPG', '<b>About IÉSEG</b><br/><br/> IÉSEG School of Management is one of the top Business Schools in France, ranked 6th in 2012 by leading student magazine L’Etudiant. As a French Grande École and member of the Conférence des Grandes Écoles IÉSEG is part of the ', 'BBA (3 Years)<br/> Bachelors of Grand Ecole Program (5 Years) <br/> MSc in Management (2 Years) <br/> Master of International Business (1 Year) <br/> Dual Degree MBA/MIB<br/> MSc in Fashion Management', '&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp', 'Phone:	  +92-42-35858043<br/> Mobile: +92-302-6175233 +92-321-4493971<br/> Email: husnain.tarar@superior.edu.pk<br/> Office Address: 31-Tipu Block, New Garden Town, Lahore, Pakistan. <br/><br/><center> <img src="../../Images/SplitDegree/IESEG3.JPG" /></ce', NULL),
(4, 'Rouen Business School, France', '../../Images/Gallary/logo_rouen.jpg', '../../Images/Banner/MOUfrancebanner.png', ' Rouen is one of the top 8th business schools in France with high qualified faculty and students from different ethnic backgrounds. This school offers top class quality education and is committed to produce pioneer business leaders, meeting employers’ nee', 'Bachelor in Business Administration<br/> Bachelor in Retail Management<br/> BSc in International Business<br/> Master in Management Grande Ecole<br/> Specialized Masters<br/> Masters of Science / MSc<br/> International MBA<br/> PhD Ecricome<br/> Executive', ' Undergraduate Programs	&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp      Euro 9600/- Per Annum  <br/> Postgraduate Programs 	&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp	Euro 9600/- to Euro13000 Per Annum <br/> Ph.D Programs 	&nbsp&', ' Email: splitdegree@superior.edu.pk<br/> Phone: 042-35330361-2, 0300-4731293<br/><br/><center><img src="../../Images/SplitDegree/RuenBsns4.JPG" /></center>', 'No Data Recived'),
