INSERT INTO `su_training` (`tra_id`, `tra_title`, `tra_description`, `tra_image`, `cen_id`) VALUES
(3, 'THE ART OF WRITING CASE STUDIES', 'The workshop on case writing was conducted to provide case teachers with the opportunity to explore the case method and assess its benefits for use in their own classes. The workshop aimed at guiding participants about case writing, providing practical ad', '../../Research/writing.jpg', 1),
(4, 'HOW TO PUBLISH IN QUALITY JOURNALS', 'This one day workshop was intended to serve as a guide to faculty members, either completing or wishing to pursue their PhDs, who need to know what steps to follow in order to publish their journal articles. The workshop was conducted by Muhammad Azam Roo', '../../Research/publishing.jpg', 2),
(5, '3 DAYS ACTIVE CITIZEN PROGRAM OF BRITISH COUNCIL', 'The active participation of youth in the development of community is of great concern. Realizing this fact, ', '../../Research/british.jpg', 1),
(6, 'CAPACITY BUILDING IN RESEARCH', 'To provide intensive research training to research scholars and faculty, a three months program of ', '../../Research/capacity.jpg', 1),
(7, 'ONE-DAY WORKSHOP ON ', 'This workshop was conducted by Dr. Muhamamd Ramzan, a seasoned researcher with more than 20 years of work experience of prestigious institutions like United States Information Service and GIK Institute of Engineering Sciences & Technology. He is Director ', '../../Research/research.jpg', 1),
(8, 'MASTERING RESEARCH TOOLS USING SPSS, AMOS, STATA AND ENDNOTE', 'A three day National level workshop was conducted on in collaboration with RCTD on 5-7 January, 2012 (Thursday-Saturday). The workshop aimed at developing advance research skills of the participants through lectures, presentations, use of different softwa', '../../Research/core-tools.jpg', 1),
(9, 'WORKSHOPS ON HOW TO PREPARE EFFECTIVE ASSIGNMENTS: THE SIGNIFICANCE AND USE OF RESEARCH TOOLS ', 'ANCRD invited Marta Lindvert, a PhD research scholar form Mid Sweden University, Sweden to deliver series of workshops on preparing effective assignments using different research tools. The workshops were especially centered on improving the research skil', '../../Research/keyword-research-in-page.jpg', 1),
(10, 'A PROJECT MANAGEMENT COURSE AND A SERIES OF INTERACTIVE SEMINARS WITH CHRISTINE MORTIMER', 'ANCRD invited Christine Mortimer, lecturer at York St John University, UK from the Faculty of Business and Communication, who delivered a comprehensive course on ', '../../Research/Images_projectmanagement.jpg', 1),
(2, 'Entrepreneurship ', 'Students need to meet veteran business experts and working executives so that they may have an enhanced exposure of the emerging market trends. CMACED organizes such forums frequently. Recently, Mr. Salim Ghauri, Chairman Netsol Technologies, was invited ', '../../Research/entrepreneur1.jpg', 2);
